import './Cards.css';
import Films from '../../swapiDataFetch';
import React from "react";

class Card extends React.Component {
    render() {
        return (
            <div>
                {Films.map(title => (
                    <div className="card">
                        <h1>{title}</h1>
                        <img src={lightsabersLit} className="lightsabersLit" />
                    </div>
                ))}
                =            </div>
        )
    }
}

export default Card;
